pragma solidity ^0.4.23;

import "./GameWallet.sol";

contract WalletDB {
    mapping(address=>GameWallet) wallets;

    function getWallet(address a) public view returns (GameWallet) {
        GameWallet w = wallets[a];
        require(w != address(0), "Wallet not found!");
        return w;
    }

    function newWallet(bool overwrite) public {
        GameWallet w = wallets[msg.sender];
        require(!(w != address(0) && !overwrite), "Wallet found but overwrite wasn't allowed!");
        wallets[msg.sender] = new GameWallet(msg.sender);
    }

    function addWallet(GameWallet w) public {
        wallets[msg.sender] = w;
    }
}
